import React, {useState} from 'react';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';

export default function AlerDialog() {

    const[open, setOpen] = useState(false);

    const openAD = () =>{
        setOpen(true);
    }

    const closeAD = () =>{
        setOpen(false);
    }

    const continueGame = () =>{
        setOpen(false);
    }

    return(
        <div>
            <Dialog open={open} onClose={closeAD}>
                <DialogTitle id="alert-dialog-description">{"Oho, pisteesi loppuivat!"}</DialogTitle>
                <DialogContent>
                    <DialogContentText id="alert-dialog-description">
                    Haluatko aloittaa alusta ja jatkaa pelaamista?
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={continueGame} autoFocus>
                        Kyll√§, haluan jatkaa!
                    </Button>
                    <Button onclick={closeAD}>
                        Ei, haluan lopettaa.
                    </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
}
